export default function Tours(){

    return toursData.map((tour)=> <Tour data={tour}/>)

}

function Tour(data){

    return (
        <div>
            <img src={data.image} alt= {data.info}></img>
            <h2>{data.name}</h2>
        </div>
    );

}
